import React from "react";
import FriendCard from "./components/FriendCard";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero"
import Footer from "./components/Footer";
import Wrapper from "./components/Wrapper";
import friends from "./friends.json";
import "./App.css";

function App() {
  return (
    // <Router>
    <div>
      {/* Navbar */}
      <Navbar />

      {/* Header */}
      <Hero backgroundImage=" https://img.freepik.com/free-vector/minimal-triangle-pattern-design-pastel-colors_1017-14885.jpg?size=338&ext=jpg">
        <h1>Clicky Game</h1>
        <h2>Click a pic to earn a point, but don't click the same pic more than once!</h2>
      </Hero>

      <Wrapper>
        <FriendCard
          name={friends[0].name}
          image={friends[0].image}
          occupation={friends[0].occupation}
          location={friends[0].location}
        />
        <FriendCard
          name={friends[1].name}
          image={friends[1].image}
          occupation={friends[1].occupation}
          location={friends[1].location}
        />
        <FriendCard
          name={friends[2].name}
          image={friends[2].image}
          occupation={friends[2].occupation}
          location={friends[2].location}
        />
      </Wrapper>

      <Footer />
    </div>

  );
}

export default App;
